11384=>["Value"=>11384,"TextKey"=>"图鉴描述10501","TextValue"=>"The King of the Hill Kingdom. A total sweet tooth. He's loved by the people for being happy-go-lucky, amiable and charismatic."],
11385=>["Value"=>11385,"TextKey"=>"图鉴描述10502","TextValue"=>"เป็นที่รู้จักกันดีในฐานะหนึ่งในพ่อมดที่ยอดเยี่ยมที่สุดของยุค มีพรสวรรค์เรื่องความอัจฉริยะ ความเมตตากรุณา ไมตรีจิต และการหยั่งรู้ ในบรรดาการปลอมตัวทั้งหมด เขามักจะแปลงร่างเป็นกระต่าย มีเพียงแค่ไม่กี่คนเท่านั้นที่เคยเห็นใบหน้าที่แท้จริงของเขาเบื้องหลังมายากล"],
11386=>["Value"=>11386,"TextKey"=>"图鉴描述10503","TextValue"=>"นักเล่าเรื่องและนักแต่งเพลงในตำนานของเผ่า เขาท่องไปทั่วพื้นแผ่นดินและท้องทะเล แต่ไม่มีใครเคยเห็นเขา เขาได้รับการสรรเสริญไปทั่วเพราะเขามีน้ำเสียงและสติปัญญาที่ลึกซึ้ง  "],
11387=>["Value"=>11387,"TextKey"=>"图鉴描述10504","TextValue"=>"บริสุทธิ์และไร้มลทิน เต็มไปด้วยความอยากรู้อยากเห็นเกี่ยวกับโลกภายนอก เธอชอบตีกลองเวลารู้สึกประทับใจ"],
11388=>["Value"=>11388,"TextKey"=>"图鉴描述10505","TextValue"=>"ราชาแห่งสิงโตที่เดินเหมือนกับมนุษย์ เขาเคยเสียบ้านเกิดที่สวยงามไปพร้อมกับสมาชิกในเผ่า แต่ด้วยความแข็งแกร่งและความกล้าหาญที่ยอดเยี่ยม ผู้นำที่แท้จริงจะนำทุกสิ่งกลับคืนมาในที่สุด"],
11389=>["Value"=>11389,"TextKey"=>"图鉴描述10506","TextValue"=>"Walked out of a heartbreaking past, she becomes stronger and more optimistic. She also learnt a magic that can makes visions in match flames come true."],
11390=>["Value"=>11390,"TextKey"=>"图鉴描述10507","TextValue"=>"He's wee stingy and naughty. Was once cursed by the Witch because of his prank. With a pumpkin head, he becomes more kind, often holding a lantern to light passers-by in the dark."],
