12682=>["Value"=>12682,"TextKey"=>"新手引导说明2000","TextValue"=>"<line-height=130%>ท่านผู้เมตตา โปรดช่วยข้าที!"],
12683=>["Value"=>12683,"TextKey"=>"新手引导说明2001","TextValue"=>"<line-height=130%>ข้าติดอยู่ใน<color=#38c0a5>โทเท็ม</color>พวกนี้!"],
12684=>["Value"=>12684,"TextKey"=>"新手引导说明2002","TextValue"=>"ลาก<color=#38c0a5>โทเท็ม</color>ชนิดเดียวกัน 3 ชิ้นมาวางเรียงติดกันเพื่อ<color=#f58c26>รวม</color>โทเท็มและถอนคำสาป"],
12685=>["Value"=>12685,"TextKey"=>"新手引导说明2010","TextValue"=>"<line-height=130%>อ๊ะ! ฉันไม่เห็นโทเท็มแถวนี้เลย!"],
12686=>["Value"=>12686,"TextKey"=>"新手引导说明2011","TextValue"=>"<line-height=130%>ดูนั่นสิ! <color=#f58c26>บัญญัติแห่งการสรรสร้าง</color> คุณจะพบหนังสือเล่มนี้ได้ในหลายๆ ด่าน มาดูกันว่ามีอะไรเขียนเอาไว้"],
12687=>["Value"=>12687,"TextKey"=>"新手引导说明2012","TextValue"=>"<line-height=130%>แตะเพื่อรับเคล็ดลับที่เป็นประโยชน์สำหรับการเล่นเกม ลองดูสิ!"],
12688=>["Value"=>12688,"TextKey"=>"新手引导说明2020","TextValue"=>"<line-height=130%>คุณต้องได้รับ<color=#f58c26>วัตถุที่กำหนด</color> ถึงจะผ่านด่าน"],
12689=>["Value"=>12689,"TextKey"=>"新手引导说明2022","TextValue"=>"<line-height=130%><color=#f58c26>เป้าหมายของด่าน</color>จะบอกคุณว่าจำเป็นต้องมีของชิ้นใด เริ่มรวมและคว้าชัยชนะได้เลย!"],
12690=>["Value"=>12690,"TextKey"=>"新手引导说明2030","TextValue"=>"<line-height=120%>ว้าว <color=#ef933d>รูปสลักเอ็มบลาวัยเด็ก</color>! พลังของรูปสลักก็อ่อนแรงลงด้วย! เราต้องปลุก<color=#f58c26>เอ็มบลา</color>ขึ้นมาด้วยการรวมรูปสลัก"],
12691=>["Value"=>12691,"TextKey"=>"新手引导说明2031","TextValue"=>"หากด่านมีรูปสลักเหล่านี้ โดยทั่วไปคุณจะผ่านด่านเมื่อรวมรูปสลักเข้าด้วยกัน"],
12692=>["Value"=>12692,"TextKey"=>"新手引导说明2032","TextValue"=>"<line-height=130%>ดินแดนเหล่านี้ถูกตัดขาดจากพลังแห่งเทพี จึงตกอยู่ในห้วงแห่งการหลับลึก"],
12693=>["Value"=>12693,"TextKey"=>"新手引导说明2033","TextValue"=>"<line-height=130%>คุณไม่สามารถขยับวัตถุบน<color=#38aec0>ผืนดินไร้ชีวิต</color>ได้"],
12694=>["Value"=>12694,"TextKey"=>"新手引导说明2034","TextValue"=>"<line-height=130%>รวม<color=#38c0a5>ดอกไม้วิญญาณ</color>ชนิดใดก็ได้เพื่อปลุกชีวิตให้กับผืนดิน"],
12695=>["Value"=>12695,"TextKey"=>"新手引导说明2035","TextValue"=>"<line-height=130%>เมื่อคุณชนะ <color=#f58c26>เทพีเอ็มบลา</color>จะปลุกชีวิตให้กับผืนดินทุกช่อง!"],
12696=>["Value"=>12696,"TextKey"=>"新手引导说明2040","TextValue"=>"<line-height=130%>ดูสิ! นั่นมัน<color=#38c0a5>โทเท็ม</color>นี่นา"],
12697=>["Value"=>12697,"TextKey"=>"新手引导说明2041","TextValue"=>"รีบรวม<color=#38c0a5>โทเท็ม 3 อัน</color> เพื่อช่วยสมาชิกเผ่าที่ติดอยู่ข้างใน!"],
12698=>["Value"=>12698,"TextKey"=>"新手引导说明2050","TextValue"=>"อย่างที่กล่าวไป คุณสามารถแตะ<color=#38c0a5>ลูกแก้วรูนธรรมชาติ</color>เพื่อปลุกผืนดินไร้ชีวิต"],
12699=>["Value"=>12699,"TextKey"=>"新手引导说明2051","TextValue"=>"<line-height=130%>แน่นอนว่าคุณสามารถรวมเพื่อรับวัตถุเลเวลสูงกว่านี้ได้!"],
12700=>["Value"=>12700,"TextKey"=>"新手引导说明2060","TextValue"=>"คุณสามารถรวมวัตถุที่อยู่บน<color=#38aec0>ผืนดินไร้ชีวิต</color>ได้ โดยนำวัตถุชนิดเดียวกันไปเรียงบนผืนดินปกติที่อยู่ข้างๆ เพื่อปลุกวัตถุบนผืนดินไร้ชีวิตโดยอัตโนมัติ"],
12701=>["Value"=>12701,"TextKey"=>"新手引导说明2070","TextValue"=>"แตะ<color=#38c0a5>กลุ่มโทเท็ม</color>เพื่อรับ<color=#38c0a5>โทเท็ม</color>"],
12702=>["Value"=>12702,"TextKey"=>"新手引导说明2080","TextValue"=>"<color=#38aec0>ผืนดินไร้ชีวิตขั้นสูง</color>บางแห่งไม่สามารถปลุกได้ด้วย<color=#f58c26>คะแนนการฟื้นฟู</color> ต้องปลุกโดยนำวัตถุชนิดเดียวกันไปเรียงบนผืนดินปกติที่อยู่ใกล้ๆ เท่านั้น"],
12703=>["Value"=>12703,"TextKey"=>"新手引导说明2090","TextValue"=>"<line-height=130%>จากนี้ไป ด่านต่างๆ จะมาพร้อมกับ<color=#f58c26>ภารกิจ</color>"],
12704=>["Value"=>12704,"TextKey"=>"新手引导说明2091","TextValue"=>"<line-height=130%>คุณสามารถตรวจสอบ<color=#38c0a5>ดวงอาทิตย์ภารกิจ</color> เพื่อรับข้อมูลภารกิจและรางวัล"],
12705=>["Value"=>12705,"TextKey"=>"新手引导说明2093","TextValue"=>"<line-height=130%>ปุ่มนี้สามารถล็อกหรือปลดล็อก<color=#f58c26>ฟังก์ชันการลากหน้าจอ</color>"],
12706=>["Value"=>12706,"TextKey"=>"新手引导说明2100","TextValue"=>"วัตถุบางอย่างไม่สามารถรวมโดยตรงได้ แตะ<color=#ef933d>กองหินรูปลิ่ม</color>เพื่อแบ่งมันให้เป็น<color=#ef933d>หินรูปลิ่ม</color> แล้วนำมารวมกัน "],
12707=>["Value"=>12707,"TextKey"=>"新手引导说明2110","TextValue"=>"<line-height=130%>คุณจำเป็นต้องตรวจสอบ<color=#f58c26>เป้าหมายของด่าน</color>"],
12708=>["Value"=>12708,"TextKey"=>"新手引导说明2130","TextValue"=>"<line-height=130%>เราอาจได้รับ<color=#ef933d>หน่ออ่อนไม้พุ่ม</color>จาก<color=#38c0a5>กระดูกมังกร</color>"],
12709=>["Value"=>12709,"TextKey"=>"新手引导说明2140","TextValue"=>"นี่คือ<color=#ef933d>ระเบิดปลุกชีวิต</color> ถ้าคุณปลุกชึวิตผืนดินที่อยู่ติดกับระเบิด ระเบิดจะปลุกผืนดินติดกันรอบข้างโดยอัตโนมัติ"],
12710=>["Value"=>12710,"TextKey"=>"新手引导说明2150","TextValue"=>"สมาชิกเผ่าสามารถเก็บ<color=#38c0a5>แร่</color>ให้คุณจาก<color=#38c0a5>เถาวัลย์</color>เลเวลสูงได้"],
12711=>["Value"=>12711,"TextKey"=>"新手引导说明2160","TextValue"=>"นี่คือ<color=#ef933d>หลุมศพทรุดโทรม</color> หากคุณปล่อยไว้ มันจะเปลี่ยนเป็น<color=#df66a8>ซอมบี้</color>ผู้น่ากลัว ปราบมันเพื่อรับ<color=#38c0a5>หิ่งห้อย</color> ซึ่งเป็นสิ่งจำเป็นในการผ่านด่าน"],
12712=>["Value"=>12712,"TextKey"=>"新手引导说明2170","TextValue"=>"<color=#ef933d>รังถูกทิ้ง</color>จะสร้างซอมบี้ออกมาเรื่อยๆ แม้จะอยู่ในผืนดินไร้ชีวิต เมื่อแตะจะสร้างซอมบี้ออกมาทันที! ทำลายซอมบี้เพื่อรับ<color=#38c0a5>แร่</color>"],
12713=>["Value"=>12713,"TextKey"=>"新手引导说明2180","TextValue"=>"นี่คือ<color=#38c0a5>ประตูมิติรูนของดรูอิด</color> พวกเราช่างโชคดีจริงๆ! รวมเพื่อเรียก<color=#38c0a5>สมาชิกเผ่า</color>จากบ้านเกิดมาช่วยคุณ"],
12714=>["Value"=>12714,"TextKey"=>"新手引导说明2190","TextValue"=>"ชิ้นส่วนที่เหลืออยู่ของต้นไม้ศักดิ์สิทธิ์แห่งการสรรสร้าง ผลิต<color=#38c0a5>ลูกแก้วรูนธรรมชาติ</color>โดยอัตโนมัติ ยิ่งเลเวลสูงเท่าไหร่ก็ยิ่งมีพลังฟื้นฟูแข็งแกร่งมากเท่านั้น"],
12715=>["Value"=>12715,"TextKey"=>"新手引导说明2200","TextValue"=>" <color=#ef933d>เมฆ</color>จะปรากฏขึ้นมาเรื่อยๆ จากที่นี่ แตะเพื่อให้ฝนตก แล้วจากนั้น<color=#38c0a5>แอ่งน้ำ</color>กับ<color=#38c0a5>ดอกไม้วิญญาณ</color>จะปรากฏขึ้นมาบนพื้นที่ว่างด้านล่าง"],
12716=>["Value"=>12716,"TextKey"=>"新手引导说明2210","TextValue"=>"<line-height=130%>แปลกจัง…<color=#ef933d>รูปสลักเอ็มบลาวัยเด็ก</color>อยู่ไหนกันนะ?"],
12717=>["Value"=>12717,"TextKey"=>"新手引导说明2211","TextValue"=>"<line-height=130%>โอ้ ใช่แล้ว ถ้าคุณทำ<color=#f58c26>ภารกิจ</color>สำเร็จ สิ่งเหล่านั้นจะหายไป!"],
12718=>["Value"=>12718,"TextKey"=>"新手引导说明2220","TextValue"=>"นี่คือ<color=#ef933d>รูปปั้นปีศาจ</color> ช่างเป็นผลงานอันชั่วร้าย! สั่งให้คนของคุณกำจัดมันเพื่อรับ<color=#ef933d>รูปสลักเอ็มบลาวัยเด็ก</color>"],
12719=>["Value"=>12719,"TextKey"=>"新手引导说明2230","TextValue"=>"<line-height=130%>ค่ายแห่งใหม่เปิดแล้ว! แวะไปดูในแผนที่โลกได้เลย!"],
12720=>["Value"=>12720,"TextKey"=>"新手引导说明2240","TextValue"=>"<line-height=130%>ข้าเป็นอิสระอีกครั้ง! ขอบคุณท่านมาก! "],
12721=>["Value"=>12721,"TextKey"=>"新手引导说明2241","TextValue"=>"<line-height=130%>คนจากเผ่าของเราถูกกักขังไว้ใน<color=#38c0a5>โทเท็ม</color>เหล่านี้"],
12722=>["Value"=>12722,"TextKey"=>"新手引导说明2242","TextValue"=>"<line-height=130%>เผ่าต้องการให้ท่านช่วยตามหาสมาชิกเผ่าคนอื่น ณ ที่แห่งนี้ รวมถึงที่บ้านเกิดด้วย"],
12723=>["Value"=>12723,"TextKey"=>"新手引导说明2243","TextValue"=>"<line-height=130%>ไปค้นหาพวกเขาในด่านต่อไปได้เลย!"],
12724=>["Value"=>12724,"TextKey"=>"新手引导说明2250","TextValue"=>"คุณสามารถ<color=#f58c26>แตะสองครั้ง</color>ที่วัตถุบางชิ้นเพื่อเรียกสมาชิกเผ่ามาเก็บทรัพยากร"],
12725=>["Value"=>12725,"TextKey"=>"新手引导说明2251","TextValue"=>"<line-height=130%>คุณสามารถใช้หรือรวมวัตถุที่เก็บมาได้"],
12726=>["Value"=>12726,"TextKey"=>"新手引导说明2252","TextValue"=>"<line-height=130%>เก็บเกี่ยวจาก<color=#38c0a5>ดอกไม้วิญญาณ</color>เพื่อรับ<color=#38c0a5>ลูกแก้วรูนธรรมชาติ</color>"],
12727=>["Value"=>12727,"TextKey"=>"新手引导说明2253","TextValue"=>"<color=#f58c26>แตะลูกแก้ว</color>เพื่อปลุก<color=#38aec0>ผืนดินไร้ชีวิต</color>"],
12728=>["Value"=>12728,"TextKey"=>"新手引导说明2261","TextValue"=>"<line-height=130%>จากนี้ไป คุณสามารถเลือกรางวัลได้เมื่อเล่นจบแต่ละด่าน"],
12729=>["Value"=>12729,"TextKey"=>"新手引导说明2262","TextValue"=>"<line-height=130%>โดยทั่วไปรางวัลจะเป็น<color=#38c0a5>ทอง</color>หรือทรัพยากรอื่นๆ ที่เป็นประโยชน์ บางครั้งอาจเป็นถึงโทเท็ม!"],
12730=>["Value"=>12730,"TextKey"=>"新手引导说明2263","TextValue"=>"<line-height=130%>รางวัลของคุณจะบรรจุใน<color=#f58c26>ฟองอากาศ</color> และถูกส่งกลับบ้าน"],
12731=>["Value"=>12731,"TextKey"=>"新手引导说明3000","TextValue"=>"<line-height=130%>ที่นี่คือ<color=#f58c26>บ้านเกิด</color>ของเรา"],
12732=>["Value"=>12732,"TextKey"=>"新手引导说明3001","TextValue"=>"<line-height=130%>ที่แห่งนี้เคยเป็นบ้านของเรา ก่อนที่<color=#f58c26>มหาอุทกภัย</color>ทำลายชีวิตอันแสนสงบของเราไป ทิ้งให้ม่านหมอกหนาทึบปกคลุมดินแดน"],
12733=>["Value"=>12733,"TextKey"=>"新手引导说明3002","TextValue"=>"<line-height=105%>นำวัตถุมารวมกับวัตถุชนิดเดียวกันบนผืนดินไร้ชีวิตเพื่อปลุกผืนดินนั้นโดยตรง! พยายามรวมวัตถุเพื่อช่วยสมาชิกเผ่ามากกว่านี้! ยิ่งคุณมีประชากรมากเท่าไหร่ ก็ยิ่งสามารถเปิดหมอกได้มากขึ้น และบูรณะบ้านเกิดของเรากลับมาได้เร็วขึ้น"],
12734=>["Value"=>12734,"TextKey"=>"新手引导说明3005","TextValue"=>"<line-height=130%>คุณสามารถปลดล็อก<color=#38c0a5>หีบสมบัติจับเวลา</color>ได้คราวละหนึ่งใบเท่านั้น รอให้เวลานับถอยหลังสิ้นสุดลงเพื่อรับของในหีบ หรือใช้ทับทิมเพื่อรับของใน<color=#38c0a5>หีบสมบัติจับเวลา</color>ทันที"],
12735=>["Value"=>12735,"TextKey"=>"新手引导说明3006","TextValue"=>"<line-height=130%>รางวัลด่านมาถึงแล้ว! เปิดฟองอากาศแล้วเช็กดูได้เลย!"],
12736=>["Value"=>12736,"TextKey"=>"新手引导说明3010","TextValue"=>"<line-height=130%><color=#38c0a5>ที่อยู่อาศัย</color> เป็นสถานที่ให้คนงานใช้พักผ่อน พวกเขาจะออกมาทำงานต่อหลังจากพักผ่อนครบเวลาที่กำหนด"],
12737=>["Value"=>12737,"TextKey"=>"新手引导说明3011","TextValue"=>"<line-height=130%><color=#38c0a5>ที่อยู่อาศัย</color>สามารถนำมารวมให้เลเวลสูงขึ้นได้ ยิ่งเลเวลสูงเท่าไหร่ สมาชิกเผ่าที่พักผ่อนในนั้นจะยิ่งหายเหนื่อยเร็วขึ้น"],
12738=>["Value"=>12738,"TextKey"=>"新手引导说明3016","TextValue"=>"<line-height=130%>ใช้<color=#38c0a5>ทับทิม</color>เพื่อปลุกพวกเขาทันที"],
12739=>["Value"=>12739,"TextKey"=>"新手引导说明3030","TextValue"=>"คุณสามารถทำภารกิจเพิ่มเติมที่บ้านเกิดเพื่อรับ<color=#38c0a5>มรดกที่ถูกลืม</color>เพิ่มได้ แตะเพื่อรับรางวัลพิเศษ!"],
12740=>["Value"=>12740,"TextKey"=>"新手引导说明3040","TextValue"=>"<line-height=130%>นี่คือ<color=#38c0a5>ทอง</color>ก้อนเล็ก"],
12741=>["Value"=>12741,"TextKey"=>"新手引导说明3041","TextValue"=>"<line-height=120%>คุณสามารถแตะเพื่อรับ<color=#38c0a5>ทอง</color> หรือรวมเป็นก้อนทองระดับสูงขึ้นได้"],
12742=>["Value"=>12742,"TextKey"=>"新手引导说明3042","TextValue"=>"<line-height=130%>ใช้<color=#38c0a5>ทอง</color>ซื้อสินค้าได้ที่<color=#f58c26>ร้านค้า</color>"],
12743=>["Value"=>12743,"TextKey"=>"新手引导说明3050","TextValue"=>"<line-height=130%>มีทองมากเกินไปงั้นเหรอ? นำไปซื้อของดีๆ ได้ที่ร้านค้า!"],
12744=>["Value"=>12744,"TextKey"=>"新手引导说明3060","TextValue"=>"<line-height=130%><color=#df66a8>สมาชิกเผ่า</color>ทุกคนเหนื่อยจนหมดแรงแล้ว พวกเขาต้องพักผ่อนเพื่อฟื้นฟูพลังงาน"],
12745=>["Value"=>12745,"TextKey"=>"新手引导说明3061","TextValue"=>"<line-height=130%>ได้เวลาเคลียร์ด่านและช่วยคนเพิ่มแล้ว!"],
12746=>["Value"=>12746,"TextKey"=>"新手引导说明3062","TextValue"=>"<line-height=120%>ยิ่งมีสมาชิกเผ่ามากเท่าไหร่ ก็ยิ่งเก็บทรัพยากรได้มากขึ้นก่อนจะไปพักผ่อน"],
12747=>["Value"=>12747,"TextKey"=>"新手引导说明3063","TextValue"=>"<line-height=130%>เคลียร์ด่านต่างๆ เพื่อช่วยสมาชิกเผ่าเพิ่ม"],
12748=>["Value"=>12748,"TextKey"=>"新手引导说明3064","TextValue"=>"<line-height=130%>และพาพวกเขากลับบ้าน!"],
12749=>["Value"=>12749,"TextKey"=>"新手引导说明3065","TextValue"=>"<line-height=130%>ดูนั่น! คุณสามารถไปค่ายได้โดยแตะ<color=#f58c26>แผนที่โลก</color>"],
12750=>["Value"=>12750,"TextKey"=>"新手引导说明3070","TextValue"=>"<line-height=130%>ไม่เหลือที่ว่างให้วางอะไรอีกแล้ว: พื้นที่มีวัตถุอยู่เต็มทุกช่อง!"],
12751=>["Value"=>12751,"TextKey"=>"新手引导说明3071","TextValue"=>"<line-height=130%>เลือกวัตถุ แล้วเลือกช่องข้อมูลเพื่อขายหรือทิ้ง "],
12752=>["Value"=>12752,"TextKey"=>"新手引导说明3080","TextValue"=>"นี่คือ<color=#38c0a5>มรดกต่างดาว</color> เป็นสิ่งที่หายากมากๆ! แตะเพื่อรับ<color=#38c0a5>ทับทิม</color>! หรือนำมารวมเพื่อรับมรดกเลเวลสูงขึ้นได้!"],
12753=>["Value"=>12753,"TextKey"=>"新手引导说明3090","TextValue"=>"<line-height=130%>นี่คือก้อน<color=#38c0a5>แร่</color>"],
12754=>["Value"=>12754,"TextKey"=>"新手引导说明3091","TextValue"=>"<line-height=130%>คุณสามารถแตะเพื่อรับ<color=#38c0a5>แร่</color> หรือรวมเป็นก้อนแร่ระดับสูงขึ้นได้!"],
12755=>["Value"=>12755,"TextKey"=>"新手引导说明3092","TextValue"=>"<line-height=130%>คุณสามารถใช้<color=#38c0a5>แร่</color>ที่รวบรวมมาได้ที่<color=#f58c26>ร้านค้า</color>"],
12756=>["Value"=>12756,"TextKey"=>"新手引导说明3100","TextValue"=>"<line-height=130%>ถ้าที่เก็บ<color=#38c0a5>แร่</color>เริ่มเต็ม ให้ใช้แร่ซื้อของที่ร้านค้า"],
12757=>["Value"=>12757,"TextKey"=>"新手引导说明3110","TextValue"=>"<color=#38c0a5>ที่กั้นถนน</color>ตรงนี้กวนใจข้าจริงๆ! แต่ท่านจะขยับตรงๆ ไม่ได้ ท่านสามารถสั่งให้<color=#df66a8>สมาชิกเผ่า</color>โจมตีเพื่อย่อยมันออกเป็นที่กั้นถนนขนาดเล็กลง"],
12758=>["Value"=>12758,"TextKey"=>"新手引导说明3120","TextValue"=>"<color=#38c0a5>ปืนใหญ่</color>ยิงกระสุนออกมาทำให้ผืนดินตาย และแม้ว่าตัวเองจะอยู่บนช่องผืนดินไร้ชีวิตก็ยังทำงานได้ <color=#f58c26>แถบความคืบหน้า</color>จะแสดงระยะเวลาชาร์จก่อนยิงกระสุนแต่ละครั้ง คุณต้องปลุกชีวิตผืนดินที่มันยืนอยู่ก่อน ถึงจะโจมตีปืนใหญ่ได้"],
12759=>["Value"=>12759,"TextKey"=>"新手引导说明3130","TextValue"=>"นี่คือ<color=#f58c26>แท่นบูชาฮีโร่</color> ฮีโร่จะสลับระหว่าง<color=#f58c26>โหมดพักผ่อน</color>และ<color=#f58c26>โหมดลาดตระเวน</color>"],
12760=>["Value"=>12760,"TextKey"=>"新手引导说明3131","TextValue"=>"เมื่อมีฮีโร่อยู่รอบๆ ก็จะมีเซอร์ไพรส์เพิ่มเติมทุกครั้งที่<color=#f58c26>รวมวัตถุคราวละ 4 อัน</color>!"],
12761=>["Value"=>12761,"TextKey"=>"新手引导说明3132","TextValue"=>"ถ้าคุณพวกเขาพักผ่อนอยู่ ก็สามารถใช้<color=#38c0a5>ทับทิม</color>เพื่อปลุกพวกเขาได้ทันที"],
12762=>["Value"=>12762,"TextKey"=>"新手引导说明3133","TextValue"=>"คลิกที่นี่เพื่อตรวจสอบข้อมูลของฮีโร่"],
12763=>["Value"=>12763,"TextKey"=>"新手引导说明3142","TextValue"=>"<line-height=130%>ฮีโร่เป็นสมาชิกที่แข็งแกร่งของเผ่า พวกเขาใช้สกิลพิเศษได้"],
12764=>["Value"=>12764,"TextKey"=>"新手引导说明3144","TextValue"=>"<line-height=130%>ตรวจสอบคำอธิบายสกิลฮีโร่ได้ใน<color=#f58c26>ช่องสกิลฮีโร่</color>"],
12765=>["Value"=>12765,"TextKey"=>"新手引导说明3145","TextValue"=>"<line-height=130%>คุณสามารถเพิ่มเลเวลฮีโร่ได้โดยส่ง<color=#f58c26>ภารกิจ</color>ที่สำเร็จแล้ว"],
12766=>["Value"=>12766,"TextKey"=>"新手引导说明3147","TextValue"=>"ทำภารกิจทั้งหมดให้สำเร็จเพื่อเพิ่มเลเวลฮีโร่!"],
12767=>["Value"=>12767,"TextKey"=>"新手引导说明3150","TextValue"=>"<line-height=130%>ยอดมาก! มีสมาชิกเผ่าหลายคนเป็นอิสระจากผนึกของพ่อมดแล้ว!"],
12768=>["Value"=>12768,"TextKey"=>"新手引导说明3151","TextValue"=>"เมื่อเผ่าของเรามีสมาชิกมากขึ้น ก็จะเปิด<color=#f58c26>หมอก</color>ได้มากขึ้น!"],
12769=>["Value"=>12769,"TextKey"=>"新手引导说明3152","TextValue"=>"<line-height=130%>หมอกในแต่ละพื้นที่ต้องการค่าอำนาจเผ่าที่แตกต่างกันไปในการเปิด"],
12770=>["Value"=>12770,"TextKey"=>"新手引导说明3153","TextValue"=>"<line-height=130%>ตอนนี้เราเปิดหมอกในพื้นที่นี้ได้แล้ว!"],
12771=>["Value"=>12771,"TextKey"=>"新手引导说明3161","TextValue"=>"คุณยังเปิดหมอกนี้ไม่ได้"],
12772=>["Value"=>12772,"TextKey"=>"新手引导说明3162","TextValue"=>"<line-height=130%><color=#f58c26>อำนาจเผ่า</color>ของคุณไม่สูงพอ ซื้อโทเท็มเพิ่มได้ที่ร้านค้า"],
12773=>["Value"=>12773,"TextKey"=>"新手引导说明3165","TextValue"=>"<line-height=130%>ใช้ทองเพื่อซื้อโทเท็ม!"],
12774=>["Value"=>12774,"TextKey"=>"新手引导说明3166","TextValue"=>"<line-height=130%>ราคาโทเท็มจะเพิ่มขึ้นหลังจากการซื้อแต่ละครั้ง ไปสะสมทองเพิ่มกันเถอะ!"],
12775=>["Value"=>12775,"TextKey"=>"新手引导说明2270","TextValue"=>"<line-height=130%>ด่านนี้มี<color=#f58c26>เวลาจำกัด</color> คุณต้องทำบททดสอบตามเวลาที่กำหนด มิฉะนั้นจะแพ้"],
12776=>["Value"=>12776,"TextKey"=>"新手引导说明2271","TextValue"=>"<line-height=130%>ตรวจสอบเวลาที่เหลือได้ที่นี่"],
12777=>["Value"=>12777,"TextKey"=>"新手引导说明2273","TextValue"=>"<line-height=130%>เมื่อเวลาที่เหลือลดน้อยลง สีตัวเลขจะเปลี่ยนจาก<color=#46bb83>เขียว</color>เป็น<color=#eca852>เหลือง</color> และในที่สุดก็กลายเป็น<color=#e04030>แดง</color>"],
12778=>["Value"=>12778,"TextKey"=>"新手引导说明2274","TextValue"=>"<line-height=130%>เพื่อให้ผ่านด่านได้เร็วขึ้น คุณสามารถลองเลือกสินค้าในร้านได้"],
12779=>["Value"=>12779,"TextKey"=>"新手引导说明2277","TextValue"=>"<line-height=130%>คุณสามารถใช้<color=#38c0a5>ทับทิม</color>เพื่อซื้อวัตถุสำคัญจากร้านได้โดยตรง"],
12780=>["Value"=>12780,"TextKey"=>"新手引导说明2281","TextValue"=>"<line-height=130%>ด่านประเภทนี้จะมอบ<color=#38c0a5>สมาชิกเผ่า</color>เป็นรางวัล คุณสามารถใช้<color=#38c0a5>ทับทิม</color>เพื่อเพิ่มรางวัลที่ได้รับเป็นสองเท่า"],
12781=>["Value"=>12781,"TextKey"=>"新手引导说明2290","TextValue"=>"<line-height=130%>ยินดีต้อนรับสู่บททดสอบจากเทพเจ้าอีกด่าน! ถ้าทำภารกิจท้าทายสำเร็จ คุณก็จะได้รับรางวัลด้วย"],
12782=>["Value"=>12782,"TextKey"=>"新手引导说明2291","TextValue"=>"<line-height=130%>คุณสามารถทำทดสอบได้ <color=#f58c26>3 ครั้ง</color> แต่กำหนดเวลาก็จะน้อยลงเรื่อยๆ ในแต่ละครั้ง"],
12783=>["Value"=>12783,"TextKey"=>"新手引导说明3149","TextValue"=>"<line-height=130%>ในการเพิ่มเลเวลฮีโร่ คุณจะต้องรอให้เวลาการฝึกจบลง หรือใช้<color=#38c0a5>ทับทิม</color>เพื่อเร่งความเร็ว"],
12784=>["Value"=>12784,"TextKey"=>"新手引导说明2300","TextValue"=>"<line-height=130%>ดูสิ นั่นคือ<color=#46bb83>รูกุญแจวิเศษ</color> เป็นอุปกรณ์ที่ควบคุมหมอกปริมาณมาก"],
12785=>["Value"=>12785,"TextKey"=>"新手引导说明2301","TextValue"=>"<line-height=130%>ลากวัตถุที่เกี่ยวข้องเข้าไปในรูกุญแจวิเศษเพื่อสลายหมอก"],
12786=>["Value"=>12786,"TextKey"=>"新手引导说明2302","TextValue"=>"<line-height=130%>ถ้ารูกุญแจยังอยู่บนผืนดินไร้ชีวิต ให้ปลุกผืนดินช่องนั้นก่อน"],
12787=>["Value"=>12787,"TextKey"=>"新手引导说明2400","TextValue"=>"<line-height=130%>ยินดีต้อนรับสู่อีเวนต์! อีเวนต์จะเปิดให้เล่นเป็นเวลาจำกัด!"],
12788=>["Value"=>12788,"TextKey"=>"新手引导说明2401","TextValue"=>"<line-height=130%>การเข้าร่วมอีเวนต์จะมอบรางวัลมากมาย และระบบจะส่งรางวัลไปยังบ้านเกิดของคุณ!"],
12789=>["Value"=>12789,"TextKey"=>"新手引导说明2402","TextValue"=>"<line-height=130%>ในที่แห่งนี้คุณจะเห็นวัตถุที่ไม่เหมือนที่อื่น สิ่งมีชีวิตใหม่ๆ และเกมเพลย์แบบใหม่!"],
12790=>["Value"=>12790,"TextKey"=>"新手引导说明3180","TextValue"=>"<line-height=130%>กองไฟเป็นสิ่งจำเป็นสำหรับการเดินหน้าต่อไปยังด่านต่างๆ! ซึ่งจะเติมเพิ่มขึ้นเมื่อเวลาผ่านไป"],
12791=>["Value"=>12791,"TextKey"=>"新手引导说明3181","TextValue"=>"<line-height=130%>ตอนนี้คุณมีกองไฟมากมาย! ใช้มันเข้าไปเล่นในด่านสิ!"],
12792=>["Value"=>12792,"TextKey"=>"新手引导说明1072","TextValue"=>"<line-height=130%>จากนี้ไป คุณสามารถตรวจสอบ<color=#38c0a5>รางวัลค่าย</color>ได้แล้ว!"],
12793=>["Value"=>12793,"TextKey"=>"新手引导说明1073","TextValue"=>"<line-height=130%>เมื่อถึงเวลา คุณก็สามารถรับรางวัลได้!"],
12794=>["Value"=>12794,"TextKey"=>"新手引导说明1074","TextValue"=>"<line-height=130%>ยิ่งได้ดาวจากด่านมากเท่าไหร่ ก็ยิ่งได้รางวัลมากขึ้นเท่านั้น!"],
12795=>["Value"=>12795,"TextKey"=>"新手引导说明2235","TextValue"=>"<line-height=130%>ดูนั่น! อยู่บนแผนที่ตรงนั้นไง! ปลดล็อกแล้วลองตรวจสอบดูได้เลย!"],
12796=>["Value"=>12796,"TextKey"=>"新手引导说明2310","TextValue"=>"<line-height=130%>หน่วยสอดแนมของเราพบสถานที่ที่เหมาะกับการสร้างค่ายแห่งใหม่ ไปดูกันเถอะ!"],
12797=>["Value"=>12797,"TextKey"=>"新手引导说明2315","TextValue"=>"<line-height=130%>เราอาจพบคนที่น่าสนใจมากๆ ในที่แห่งนี้!"],
12798=>["Value"=>12798,"TextKey"=>"新手引导说明2320","TextValue"=>"<line-height=130%>ยินดีต้อนรับสู่<color=#46bb83>อีเวนต์วันหยุดในแดนหิมะ</color> โลกอันแสนมหัศจรรย์รอคุณอยู่!"],
12799=>["Value"=>12799,"TextKey"=>"新手引导说明2321","TextValue"=>"<line-height=130%>การเข้าร่วม<color=#46bb83>อีเวนต์</color>เช่นนี้จะมอบรางวัลมากมาย และระบบจะส่งรางวัลไปยัง <color=#f58c26>บ้านเกิด</color>ของคุณ!"],
12800=>["Value"=>12800,"TextKey"=>"新手引导说明2322","TextValue"=>"<line-height=130%>ในที่แห่งนี้คุณจะเห็นวัตถุที่ไม่เหมือนที่อื่น สิ่งมีชีวิตใหม่ๆ และเกมเพลย์แบบใหม่!"],
12801=>["Value"=>12801,"TextKey"=>"新手引导说明2330","TextValue"=>"<line-height=130%>ยินดีต้อนรับสู่<color=#46bb83>อีเวนต์เมืองเทพนิยาย</color> โลกอันแสนมหัศจรรย์รอคุณอยู่!"],
12802=>["Value"=>12802,"TextKey"=>"新手引导说明2331","TextValue"=>"<line-height=130%>การเข้าร่วม<color=#46bb83>อีเวนต์</color>เช่นนี้จะมอบรางวัลมากมาย และระบบจะส่งรางวัลไปยัง <color=#f58c26>บ้านเกิด</color>ของคุณ!"],
