12805=>["Value"=>12805,"TextKey"=>"新手引导说明2341","TextValue"=>"<line-height=130%>การเข้าร่วม<color=#46bb83>อีเวนต์</color>เช่นนี้จะมอบรางวัลมากมาย และระบบจะส่งรางวัลไปยัง <color=#f58c26>บ้านเกิด</color>ของคุณ!"],
