12807=>["Value"=>12807,"TextKey"=>"新手引导说明2350","TextValue"=>"<line-height=130%>นี่คือ<color=#46bb83>วัตถุคะแนนอีเวนต์</color>พิเศษของอีเวนต์นี้ แตะเพื่อรับ<color=#46bb83>คะแนนอีเวนต์</color>อันหอมหวาน!"],
12808=>["Value"=>12808,"TextKey"=>"新手引导说明2352","TextValue"=>"<line-height=130%>หน้านี้แสดงรางวัลทั้งหมดที่คุณจะได้รับเมื่อสะสมคะแนนอีเวนต์ถึงเกณฑ์ที่กำหนด เมื่อคุณมีคะแนนมากพอ ระบบก็จะส่ง<color=#46bb83>รางวัลคะแนนอีเวนต์</color>ไปที่<color=#f58c26>บ้านเกิด</color>ของคุณ"],
12809=>["Value"=>12809,"TextKey"=>"新手引导说明2353","TextValue"=>"ยิ่งคุณสะสมคะแนนได้มากเท่าไหร่ ก็ยิ่งได้รางวัลมากเท่านั้น! ไปสนุกกันได้เลย!"],
12810=>["Value"=>12810,"TextKey"=>"新手引导说明3200","TextValue"=>"<line-height=130%>มี<color=#f58c26>ภารกิจประจำวัน</color>ให้ ไปลองทำดูเลย!"],
12811=>["Value"=>12811,"TextKey"=>"新手引导说明3203","TextValue"=>"<line-height=130%>คุณจะได้รับ<color=#f58c26>ภารกิจประจำวัน</color>ทุกวัน เมื่อทำสำเร็จหนึ่งภารกิจก็จะได้รับรางวัล"],
