12813=>["Value"=>12813,"TextKey"=>"新手引导说明2420","TextValue"=>"<line-height=130%>หวัดดี ข้าชื่อเหมียวเหมียว ยินดีต้อนรับสู่อาณาจักร<color=#46bb83>เหมียวเหมียว</color>! ดินแดนอันแสนมหัศจรรย์ของข้ารอเจ้าอยู่นะ!"],
