12854=>["Value"=>12854,"TextKey"=>"新手引导说明2665","TextValue"=>"Anytime when you merge 5 items together, you will get <color=#ef933d>2 Items</color> of the next level. Don't forget the rules of <color=#ef933d>3 Merge</color> and <color=#ef933d>5 Merge</color>!"],
12855=>["Value"=>12855,"TextKey"=>"新手引导说明2671","TextValue"=>"Attention! This <color=#ef933d>Crystal</color> looks magical. Let's see what's going to happen if we merge three crystals together!"],
12856=>["Value"=>12856,"TextKey"=>"新手引导说明2673","TextValue"=>"<color=#ef933d>Advanced Magic Crytal</color> can be merged with any other two items. Kind of like the wild card in poker games. Try to merge this Magic Crytal with others."],
12857=>["Value"=>12857,"TextKey"=>"新手引导说明2675","TextValue"=>"Remember the <color=#ef933d>Advanced Magic Crytal</color> can be played as a wild card!"],
