13618=>["Value"=>13618,"TextKey"=>"剧情ID1010101","TextValue"=>"<line-height=130%>สวัสดี ท่านหัวหน้าเผ่าของข้า ข้าชื่อทริสตัน เป็นหน่วยสอดแนมของท่าน! ข้าดีใจที่พวกเราทุกคนรอดจากการเดินทางอันแสนลำบากมาได้ ในที่สุดเราก็ถึงฝั่ง เพราะฉะนั้นมาตั้ง<color=#f58c26>ค่าย</color>กันก่อนเถอะ "],
13619=>["Value"=>13619,"TextKey"=>"剧情ID1010102","TextValue"=>"<line-height=130%>ที่นี่อุดมสมบูรณ์พอตัวเลย! ไม่รู้ว่าจะได้เจออะไรบ้าง? มาเริ่มจากการตั้งเต็นท์เพื่อปกป้องตัวเองก่อนดีกว่า!"],
13620=>["Value"=>13620,"TextKey"=>"剧情ID1010201","TextValue"=>"<line-height=130%>โอ ท่านหัวหน้าเผ่า ดูผืนดินอันน่าเกลียดนี้สิ… แล้วก็เต็นท์โทรมๆ นี่ด้วย! ข้าคิดถึงบ้านเหลือเกิน…"],
13621=>["Value"=>13621,"TextKey"=>"剧情ID1010202","TextValue"=>"เอาน่า เอ็นด้า ข้ารู้ว่าการจากบ้านเกิดมาเป็นเรื่องที่ลำบาก แต่ทางเดียวที่จะช่วยบ้านของเราได้ก็คือต้องออกเดินทาง ภัยพิบัติอันแสนพิลึกพิลั่นนั่น…เราต้องหาคำตอบให้ได้! พวกเราเลยต้องเดินทางมาขอความช่วยเหลือไง"],
13622=>["Value"=>13622,"TextKey"=>"剧情ID1010203","TextValue"=>"<line-height=130%> เดี๋ยวยังไงเราก็จะต้องกลับไปสักวันอยู่ดี เข้าใจไหม? มาเริ่มจากการสร้าง<color=#f58c26>แท่นบูชา</color>ให้ท่านได้พูดคุยกับเทพเจ้า ดีมั้ย นักบวชเอ็นด้า? ท่านหัวหน้าเผ่าก็จะช่วยด้วยนะ!"],
13623=>["Value"=>13623,"TextKey"=>"剧情ID1020101","TextValue"=>"<line-height=130%>ดูสิว่าเราเจออะไร! <color=#ef933d>มรดกแห่งผืนดิน</color>! นี่คือทุกสิ่งที่เราต้องการสำหรับ<color=#f58c26>แท่นบูชา</color> และในที่สุดเราก็หาวิธีหลุดพ้นจากโทเท็มพวกนั้นแล้ว! ช่างเป็นสถานที่ศักดิ์สิทธิ์จริงๆ!"],
13624=>["Value"=>13624,"TextKey"=>"剧情ID1020201","TextValue"=>"<line-height=130%>แสดงว่าเจ้าก็ยังไม่ไร้ประโยชน์ซะทีเดียวสินะ เจ้า ชื่ออะไร-สตันนะ ถึงมันจะเล็กแล้วก็ไม่เกรงขามเหมือนที่บ้าน แต่ก็พอใช้แทนไปก่อนได้! เอาล่ะ ไปได้แล้ว!"],
13625=>["Value"=>13625,"TextKey"=>"剧情ID1020202","TextValue"=>"<line-height=130%>โอ ช่างน่ารักจริงๆ ดูสิว่าเธอมีความสุขแค่ไหน ถึงวิธีพูดขอบคุณของเธอจะแปลกประหลาดสักหน่อยก็เถอะ!"],
13626=>["Value"=>13626,"TextKey"=>"剧情ID1020203","TextValue"=>"<line-height=130%> (จบการเต้นท่าประหลาด) เทพเจ้าของเราบอกข้าว่าเราอยู่ในที่ที่ถูกต้องแล้ว และบุคคลผู้ยิ่งใหญ่จะมาช่วยพวกเรา…"],
13627=>["Value"=>13627,"TextKey"=>"剧情ID1020204","TextValue"=>"<line-height=130%>จริงรึ? นี่เป็นข่าวดีจริงๆ! เมื่อไหร่เราจะได้เจอบุคคลผู้ยิ่งใหญ่คนนั้นล่ะ?"],
13628=>["Value"=>13628,"TextKey"=>"剧情ID1020301","TextValue"=>"<line-height=130%> เจ้าคือคนชั่วช้าที่รบกวนการหลับใหลของข้างั้นรึ?! "],
13629=>["Value"=>13629,"TextKey"=>"剧情ID1020302","TextValue"=>"<line-height=130%>…...แล้วท่านคือ?"],
13630=>["Value"=>13630,"TextKey"=>"剧情ID1020303","TextValue"=>"<line-height=130%>ข้าคือดรูอิดสูงสุด บิดาแห่งเหล่านักกวี ผู้พิชิตวายุ ผู้คุ้มครองนักผจญภัย ผู้นำสารอันน่าเกรงขามแห่งเทพเจ้า เพชฌฆาต และผู้พิพากษาทัณฑ์ อะเมอร์กิ้นผู้ร่ายบทเพลง! "],
13631=>["Value"=>13631,"TextKey"=>"剧情ID1020304","TextValue"=>"<line-height=130%>อา…...ยินดีที่ได้เจอท่าน ล่ะมั้งนะ? เราเพิ่งมาที่นี่เป็นครั้งแรก แล้วเราก็เพิ่งรู้ว่า…"],
13632=>["Value"=>13632,"TextKey"=>"剧情ID1020305","TextValue"=>"<line-height=130%>ว่าไงนะ?! ผู้บุกรุกงั้นรึ?! ข้าจะไม่ให้พวกเจ้าทำลายบ้านของเรา และทำให้ครอบครัวต้องพลัดพรากหรอกนะ! "],
13633=>["Value"=>13633,"TextKey"=>"剧情ID1020401","TextValue"=>"ว่าไงนะ? ไม่ ไม่ใช่! พวกเราไม่ได้มาบุกรุกท่าน เราแค่พยายามหาที่พัก แล้วก็ไขปริศนาที่เกิดขึ้นกับบ้านเกิด……"],
13634=>["Value"=>13634,"TextKey"=>"剧情ID1020402","TextValue"=>"ไม่นะ! สะพาน! ดูซิว่าเจ้าทำอะไรลงไป! เทพเจ้าจะต้องโกรธแน่ๆ! เดี๋ยวนะ…เมื่อกี้เจ้าบอกว่าเจ้าเป็นใครนะ? อะเมอร์กิ้น? ดรูอิดสูงสุดอะเมอร์กิ้น? จากตำนานงั้นรึ?!"],
13635=>["Value"=>13635,"TextKey"=>"剧情ID1020403","TextValue"=>"เจ้า…... ไม่ใช่ผู้บุกรุกงั้นรึ? พวกเจ้าเป็นใคร? ทำไมเจ้าถึงมาที่นี่? เดี๋ยวนะ…ทำไมข้าถึงมาอยู่ที่นี่ ที่นี่ที่ไหนกัน? แล้วผู้คนของข้าอยู่ไหน? ข้าไม่รู้จักดินแดนแห่งนี้เลย…"],
13636=>["Value"=>13636,"TextKey"=>"剧情ID1020404","TextValue"=>"ต้องขอโทษด้วย ข้าเองก็ไม่มีคำตอบให้ท่านเหมือนกัน เราเดินทางมาไกลแสนไกล เสี่ยงชีวิตเพื่อมาถึงที่นี่ พยายามหาใครก็ตามที่จะช่วยไขปริศนาที่เกิดขึ้นกับบ้านเกิดของข้า อย่างแรกก็คือ มีหมอกหนาปรากฏขึ้นในดินแดนของเรา จากนั้น…"],
13637=>["Value"=>13637,"TextKey"=>"剧情ID1020405","TextValue"=>"ปีที่ผ่านมาก็เกิดน้ำท่วมหนักที่สุดในรอบทศวรรษ และที่แปลกมากๆ ก็คือ จู่ๆ ผู้คนก็กลายร่างเป็นโทเท็มไร้ชีวิต! ไม่น่าเชื่อเลยใช่มั้ยล่ะ?!"],
13638=>["Value"=>13638,"TextKey"=>"剧情ID1020406","TextValue"=>"อา…นั่น…เป็นเรื่องที่ต้องทำความเข้าใจพอสมควรเลย ต้องขอโทษด้วยที่โจมตีพวกเจ้าและทำลายสะพาน เอาเป็นว่า ข้าจะช่วยสร้างมันขึ้นมาใหม่ก็แล้วกัน"],
13639=>["Value"=>13639,"TextKey"=>"剧情ID1020407","TextValue"=>"อะเมอร์กิ้น?! อะเมอร์กิ้นผู้ยิ่งใหญ่งั้นรึ?! ผ้าคลุมของท่าน พลังในการบงการพายุ... ท่านมีตัวตนอยู่จริง! หมายความว่าเรื่องเล่าในหนังสือของตระกูลข้าเป็นเรื่องจริงงั้นเหรอ!"],
13640=>["Value"=>13640,"TextKey"=>"剧情ID1020408","TextValue"=>"<line-height=130%>คนงาน! ไปเตรียมตัวให้พร้อม แล้วก็สร้างสะพานนั่นขึ้นมาใหม่!"],
13641=>["Value"=>13641,"TextKey"=>"剧情ID1020409","TextValue"=>"<line-height=130%>แต่เราบาดเจ็บอยู่นะ! ตอนนี้เราสร้างอะไรไม่ไหวหรอก! "],
13642=>["Value"=>13642,"TextKey"=>"剧情ID1020410","TextValue"=>"ข้ารู้ทางแก้พอดี การเดินทางนานนับปีทำให้ข้ามีความรู้เรื่องสมุนไพร เราไปเก็บสมุนไพรมาสร้าง<color=#f58c26>สวนสมุนไพร</color>ที่นี่กันดีกว่า เพื่อเป็นการไถ่โทษที่ทำให้พวกเจ้าวุ่นวาย"],
13643=>["Value"=>13643,"TextKey"=>"剧情ID1020411","TextValue"=>"ขอบคุณมาก! ท่านนี่ช่างเมตตาเหลือเกิน เอาล่ะ เราจะกลับไปที่บ้านเกิดเมื่อเรารู้วิธีปลดปล่อยผู้ที่ติดอยู่ในโทเท็มแล้ว! ยอดมาก ไปกันเถอะ!"],
13644=>["Value"=>13644,"TextKey"=>"剧情ID1030101","TextValue"=>"<line-height=130%>เรากลับมาแล้ว และพาผู้ช่วยจากบ้านเกิดมาด้วย! มาสร้างสวนกันเถอะ!"],
13645=>["Value"=>13645,"TextKey"=>"剧情ID1030201","TextValue"=>"<line-height=130%>ว้าว น่าประทับใจจริงๆ ท่านเก่งมากเลย สวนสมุนไพรเล็กๆ นี่สวยมาก "],
13646=>["Value"=>13646,"TextKey"=>"剧情ID1030202","TextValue"=>"<line-height=130%>แล้วก็ยังเป็นประโยชน์อีกด้วย ตอนนี้คนงานหายดีแล้ว และพร้อมสร้างสะพานขึ้นมาใหม่ในไม่ช้า!"],
13647=>["Value"=>13647,"TextKey"=>"剧情ID1030203","TextValue"=>"<line-height=130%>ยินดีที่ได้ช่วยนะ"],
13648=>["Value"=>13648,"TextKey"=>"剧情ID1030204","TextValue"=>"จะว่าไปแล้ว ท่านนักบวชก็เพิ่งชื่นชมถึงคุณธรรมและความเฉลียวฉลาดของท่าน ที่ข้าพยายามจะบอกก็คือ……"],
13649=>["Value"=>13649,"TextKey"=>"剧情ID1030205","TextValue"=>"คงจะเป็นเกียรติอย่างยิ่ง ถ้านักผจญภัยผู้มากประสบการณ์ และบุคคลสำคัญผู้ยิ่งใหญ่อย่างท่านจะมาอยู่กับเผ่าของเรา แต่ท่านเป็นถึงตำนานน่ะนะ! ท่านคงไม่มีทางมากับคนแปลกหน้าประหลาดๆ อยู่แล้ว! ท่านจะมารึเปล่า? ได้โปรดเถอะ โปรดมากับพวกเราด้วย!!!"],
13650=>["Value"=>13650,"TextKey"=>"剧情ID1030206","TextValue"=>"<line-height=130%>ได้สิ นั่นอาจเป็นเหตุผลที่ข้าถูกส่งมาที่นี่ก็ได้"],
13651=>["Value"=>13651,"TextKey"=>"剧情ID1030207","TextValue"=>"<line-height=130%>ข้ารู้อยู่แล้วล่ะ ว่าท่านคงจะไม่……ว่าไงนะ?! ท่านจะมากับเราเหรอ?! โอ ไม่อยากเชื่อเลย……นี่คือวันที่ดีที่สุดในชีวิตของข้า! "],
13652=>["Value"=>13652,"TextKey"=>"剧情ID1030208","TextValue"=>"ต้องขอโทษด้วย บางทีเธอก็คึกไปหน่อยแบบนี้แหละ ในเมื่อตอนนี้ท่านมาเป็นส่วนหนึ่งของเราแล้ว เรามาจัดงานเลี้ยงต้อนรับกันดีมั้ย?"],
13653=>["Value"=>13653,"TextKey"=>"剧情ID1030209","TextValue"=>"ไม่ต้องหรอก ข้าไม่ได้ใส่ใจกับเรื่องแบบนั้นอยู่แล้ว ตอนนี้มีสิ่งที่เร่งด่วนกว่านั้น นั่นก็คือการหาไม้มาสร้างสะพานที่ข้าทำพัง"],
13654=>["Value"=>13654,"TextKey"=>"剧情ID1030210","TextValue"=>"<line-height=130%>ช่างเป็นชายผู้มีเกียรติจริงๆ! โอ! แค่ได้พบกับเขา…...นี่คือวันที่ดีที่สุดในชีวิตของข้า!"],
13655=>["Value"=>13655,"TextKey"=>"剧情ID1040101","TextValue"=>"<line-height=130%>ท่านคือหัวหน้าเผ่า…สินะ? ขอบคุณที่ตอนนั้นช่วยข้าไว้ ตอนนี้เราพร้อมสร้างสะพานแล้วล่ะ"],
13656=>["Value"=>13656,"TextKey"=>"剧情ID1040201","TextValue"=>"<line-height=130%>ยอดเยี่ยมเหมือนใหม่! ท่านตื่นเต้นไหมที่จะได้คุยกับเทพเจ้าอีกครั้ง ท่านนักบวชเอ็นด้า?"],
13657=>["Value"=>13657,"TextKey"=>"剧情ID1040202","TextValue"=>"<line-height=130%>พร้อมยิ่งกว่าครั้งไหนๆ เลยล่ะ! "],
13658=>["Value"=>13658,"TextKey"=>"剧情ID1040301","TextValue"=>"<line-height=130%>เอาล่ะ ท่านหัวหน้าเผ่า ตอนนี้ท่านนักบวชก็ได้กลับมาพบกับแท่นบูชาสุดที่รักของเขาแล้ว คราวนี้ก็ได้เวลาทำงานของเราแล้วล่ะ…"],
13659=>["Value"=>13659,"TextKey"=>"剧情ID1040401","TextValue"=>"โอ๊ย ข้าสะดุดอะไรเนี่ย? หือ นี่มัน<color=#38c0a5>แร่</color>จาก<color=#f58c26>แท่นบูชา</color>นี่ พวกเจ้าทำงานกันไม่ระวังเลยนะ"],
13660=>["Value"=>13660,"TextKey"=>"剧情ID1040402","TextValue"=>"<line-height=130%>อะฮ่า ข้ารู้แล้ว! เราจำเป็นต้องสร้าง<color=#f58c26>โกดัง</color>เพื่อเก็บทรัพยากร คนอื่นๆ จะได้ไม่สะดุดวัสดุที่กองเกลื่อนกลาดไม่เป็นระเบียบ"],
13661=>["Value"=>13661,"TextKey"=>"剧情ID1050101","TextValue"=>"<line-height=130%>ได้ทุกอย่างที่ต้องการแล้วใช่มั้ย? ถ้างั้นก็เริ่มปาร์ตี้กันเลย! ขอโทษที ข้าหมายถึง<color=#f58c26>โกดัง</color>น่ะ"],
13662=>["Value"=>13662,"TextKey"=>"剧情ID1050201","TextValue"=>"<line-height=130%>กำแพงแข็งแรงมั่นคง พื้นที่กว้างขวางเป็นระเบียบเรียบร้อย…ช่างเป็นฝีมือการก่อสร้างที่ยอดเยี่ยมจริงๆ ท่านหัวหน้าเผ่า!"],
13663=>["Value"=>13663,"TextKey"=>"剧情ID1050202","TextValue"=>"<line-height=130%>อา……ท่านครับ? มีตัวแปดขาอยู่ข้างหลังท่านน่ะ"],
13664=>["Value"=>13664,"TextKey"=>"剧情ID1050301","TextValue"=>"ว่าไงนะ?! อะไรกัน?! นี่มันอะไรเนี่ย?! เหมือนจะเป็นร่างกายของสัตว์ที่อาศัยอยู่ในน้ำนะเนี่ย…ฮืมมม ผิวหนังของมันเป็นเมือกลื่นแล้วก็ยืดหยุ่นได้!"],
13665=>["Value"=>13665,"TextKey"=>"剧情ID1050302","TextValue"=>"<line-height=130%><color=#f58c26>คราเคน</color>! มันคือ<color=#f58c26>คราเคน</color>! ข้าเคยอ่านเรื่องของพวกมันจากหนังสือ! มันจะต้องเป็นตัวอ่อนของสัตว์ร้ายนั่นแน่ๆ! ทำไมที่นี่ถึงมี<color=#f58c26>คราเคน</color>ได้นะ?!"],
13666=>["Value"=>13666,"TextKey"=>"剧情ID1050303","TextValue"=>"อย่าวิตกกังวลไป อย่างแรก มันตายแล้ว และอย่างที่สองก็คือ มันเป็นแค่<color=#f58c26>หมึกยักษ์</color>เกยตื้นธรรมดา"],
13667=>["Value"=>13667,"TextKey"=>"剧情ID1050304","TextValue"=>"<line-height=130%>หมึกยักษ์เหรอ? ไม่เคยได้ยินมาก่อนเลย…"],
13668=>["Value"=>13668,"TextKey"=>"剧情ID1050305","TextValue"=>"แสดงว่าเจ้ามาจากดินแดนที่ไม่ติดทะเลสินะ พวกข้าเป็นเผ่าเร่ร่อน เรายังชีพด้วยท้องทะเล ก็เลยคุ้นเคยกับหมึกยักษ์พวกนี้เหมือนกับดวงดาวบนฟ้ายามค่ำคืน"],
13669=>["Value"=>13669,"TextKey"=>"剧情ID1050306","TextValue"=>"ที่จริง ตามข้ามาสิ เรามาหาเชือกกับกิ่งไม้กัน ข้าจะสอนวิธีสร้างเต็นท์ด้วยหนังหมึกยักษ์"],
13670=>["Value"=>13670,"TextKey"=>"剧情ID1060101","TextValue"=>"<line-height=130%>……แล้วก็…เรียบร้อย ดูดีกว่าที่จินตนาการไว้อีก"],
13671=>["Value"=>13671,"TextKey"=>"剧情ID1060102","TextValue"=>"<line-height=130%>มัน…งะ…...งะ…...งดงามจริงๆ!"],
13672=>["Value"=>13672,"TextKey"=>"剧情ID1060103","TextValue"=>"ต้องขอโทษด้วย ข้าเองเป็นนักทฤษฎีมากกว่านักปฏิบัติน่ะนะ งานก่อสร้างไม่ใช่เรื่องถนัดของข้า เอาล่ะ…...ข้าขอตัวไปพักก่อน……"],
13673=>["Value"=>13673,"TextKey"=>"剧情ID1060104","TextValue"=>"โอ ท่านอะเมอร์กิ้นผู้ยิ่งใหญ่! ท่านไปพักในเต็นท์หลักของเราสิ ข้าจะคอยอารักขาท่านเอง! แค่ท่านมอบภูมิปัญญาให้ข้า แล้วข้าจะคอยติดตามรับใช้ท่านไปชั่วชีวิต"],
13674=>["Value"=>13674,"TextKey"=>"剧情ID1060201","TextValue"=>"นี่ต้องเป็นฝันในวัยเด็กที่เป็นจริงของท่านนักบวชแน่ๆ ข้าดีใจที่พวกเขาสองคนเข้ากันได้นะ ว่าแต่ คิดว่าทุกอย่างมันแปลกๆ รึเปล่า ท่านหัวหน้าเผ่า?"],
13675=>["Value"=>13675,"TextKey"=>"剧情ID1060202","TextValue"=>"ผู้อาวุโสบอกว่าทุกคนที่ออกทะเลไปแทบไม่มีวันกลับได้กลับมาอีกเลย ส่วนคนที่กลับมาได้ก็เสียสติ พูดเพ้อคลั่งถึงกำแพงน้ำขนาดยักษ์ที่สุดขอบโลก"],
13676=>["Value"=>13676,"TextKey"=>"剧情ID1060203","TextValue"=>"<line-height=130%>แต่อะเมอร์กิ้นบอกว่าเขาเป็นผู้คนแห่งท้องทะเล! มนุษย์น่ะอาศัยอยู่ในทะเลไม่ได้หรอกนะ!"],
13677=>["Value"=>13677,"TextKey"=>"剧情ID1060204","TextValue"=>"<line-height=130%>นี่ก็เลยเป็นเรื่องที่น่าสนใจ แต่ยังไงก็ตาม เขาก็ไม่ได้เป็นอันตรายกับเรา เพราะฉะนั้นมาทำงานของเรากันก่อนดีกว่า "],
13678=>["Value"=>13678,"TextKey"=>"剧情ID1060205","TextValue"=>"<line-height=130%>พอสำรวจให้ทั่วแล้ว ที่นี่มีแต่สิ่งล้ำค่าเต็มไปหมด สัตว์แรงงานช่วยขนของพวกนี้กลับบ้านเกิดให้เราได้ เพราะฉะนั้น เราควรสร้าง<color=#f58c26>โรงปศุสัตว์</color>เป็นที่พักให้พวกมัน"],
13679=>["Value"=>13679,"TextKey"=>"剧情ID1070101","TextValue"=>"<line-height=130%>ดูดีนี่ ท่านหัวหน้าเผ่า! ดูเหมือนว่าเจ้าตัวน้อยพวกนั้นช่วยงานเราได้ทันทีเลย ยอดมาก!"],
13680=>["Value"=>13680,"TextKey"=>"剧情ID1070102","TextValue"=>"<line-height=130%>เราก่อสร้างเกือบเสร็จแล้ว ยังมีเรื่องสุดท้ายที่ข้าอยากให้ท่านช่วย"],
13681=>["Value"=>13681,"TextKey"=>"剧情ID1070103","TextValue"=>"<line-height=130%>เมื่อเราไปจากที่นี่ ก็อาจจะมีผู้ไม่ประสงค์ดีบุกรุกค่ายของเรา ดังนั้นเราจำเป็นต้องมีทีมลาดตระเวนมืออาชีพคอยตรวจตาาพื้นที่และปกป้องคนงานของเรา"],
13682=>["Value"=>13682,"TextKey"=>"剧情ID1070104","TextValue"=>"<line-height=130%>เราต้องสร้าง<color=#f58c26>สังเวียนฝึกซ้อม</color>!"],
13683=>["Value"=>13683,"TextKey"=>"剧情ID1070105","TextValue"=>"<line-height=130%>ใช่แล้ว เควิน <color=#f58c26>สังเวียนฝึกซ้อม</color> ออกไปหาวัสดุกันเถอะ!"],
