13701=>["Value"=>13701,"TextKey"=>"剧情ID1090206","TextValue"=>"ฮืมม...ข้าได้ยินไม่ชัดเจนนัก…แต่เดาว่า… เราจะต้องเดินทางไปทิศเหนือ ที่ที่ไม่สามารถปลูกอะไรได้ และไม่มีผู้ใดใช้ชีวิตอยู่ได้ เราจะพบกับสหายคนหนึ่งที่นั่น"],
