13706=>["Value"=>13706,"TextKey"=>"剧情ID1090302","TextValue"=>"ทุกอย่างนี้ต้องขอบคุณองค์เทพี ที่คอยดูแลและชี้นำพวกเรา และเพื่อนใหม่ของเรา ท่านอะเมอร์กิ้น ที่มอบความรู้ให้เราอย่างเอื้อเฟื้อ"],
13707=>["Value"=>13707,"TextKey"=>"剧情ID1090303","TextValue"=>"และที่สำคัญที่สุด ท่านหัวหน้าเผ่า เราคงไม่ประสบความสำเร็จ หากไม่มีผู้นำที่แข็งแกร่งและเมตตาเช่นท่าน เพราะฉะนั้น ข้าขอขอบคุณจากใจ ท่านหัวหน้าเผ่า สำหรับทุกสิ่งที่ท่านทำเพื่อเรา……เอ่อ……ท่านนักบวช นี่ท่านร้องไห้อยู่เหรอ?"],
13708=>["Value"=>13708,"TextKey"=>"剧情ID1090304","TextValue"=>"ข้า…ข้าไม่ได้…*ฮึก* ร้องไห้……ก็แค่……*ฮึก* ก็ได้ ข้าร้องไห้! ข้าร้องไห้อยู่! พอใจแล้วใช่มั้ย?! ข้ารักท่านนะ! ท่านคือหัวหน้าเผ่าที่ยอดเยี่ยมที่สุด!! "],
