13738=>["Value"=>13738,"TextKey"=>"剧情ID2030301","TextValue"=>"คุณผู้หญิงที่มีแต่เสียง เราออกมาจากอาคารแล้ว คราวนี้ท่านจะอธิบายให้ข้าฟังได้รึยังว่าเกิดอะไรขึ้นกันแน่?"],
