13742=>["Value"=>13742,"TextKey"=>"剧情ID2030305","TextValue"=>"พวกเจ้าสามคน ห้ามขยับไปไหนเด็ดขาดจนกว่าข้าจะกลับมา ถ้าข้าเห็นว่าเจ้าขยับตัวแม้แต่นิ้วเดียว รู้นะว่าจะเกิดอะไรขึ้น"],
