13745=>["Value"=>13745,"TextKey"=>"剧情ID2030402","TextValue"=>"เล่าแบบสรุปเลยก็คือ ข้าเดินทางมากับเจ้าหนุ่ม 3 คนที่ท่านจับตัวไว้ตรงนั้น แล้วข้าก็ร่วงลงมาในเหมืองนี่ แต่นั่นไม่สำคัญหรอก เพราะท่านอยู่ที่นี่แล้ว! ข้าได้รับนิมิตจากเทพเจ้า ว่าจะได้พบสหายที่ช่วยเราได้ในดินแดนอันรกร้างแห่งนี้ ไม่อยากเชื่อเลยว่าจะเป็นท่าน!"],
