13747=>["Value"=>13747,"TextKey"=>"剧情ID2030404","TextValue"=>"<line-height=130%>โจรลักพาตัว? ไม่ใช่ ไม่ใช่ ผิดแล้วล่ะ เราแค่เป็นคนที่เดินทางผ่านมา เรากำลังทำภารกิจเพื่อปกป้องบ้านเกิดน่ะ! *อธิบายเรื่องราว*"],
