13783=>["Value"=>13783,"TextKey"=>"剧情ID2060105","TextValue"=>"ผู้คนต่างเรียกข้าว่ามารดาแห่งผืนดินทุกแว่นแคว้น แค่เล่าให้ฟังเฉยๆ น่ะนะ ข้าว่าชื่อนั่นคงมาจากเจ้ากระบองเพชร "นิ้วเขียว" ต้นสวยสุดๆ เจ้าพวกนี้ไม่ใช่พืชอวบน้ำธรรมดานะ ข้าเป็นคนเพาะพันธุ์เองกับมือ"],
