14064=>["Value"=>14064,"TextKey"=>"剧情ID4050103","TextValue"=>"แต่ว่า ดูท้องฟ้าที่ครึ้ม ๆ ตอนนี้สิ เอ็นด้ากำลังขึ้นลงแท่นบูชาอย่างยากลำบาก ถ้าเธอล้มล่ะ?"],
14065=>["Value"=>14065,"TextKey"=>"剧情ID4050104","TextValue"=>"ไม่เลวเลย ชื่อสตันอะไรนะ... ดูเหมือนว่าเจ้าก็มีช่วงเวลาที่ทำตัวไม่น่ารำคานนะ"],
14066=>["Value"=>14066,"TextKey"=>"剧情ID4050105","TextValue"=>"อย่างไรเสีย เอ็นด้าก็แก่แล้ว... อืม... ฉันหมายถึงไม่อายุไม่น้อยแล้ว"],
14067=>["Value"=>14067,"TextKey"=>"剧情ID4050106","TextValue"=>"โมโหฉันจะมีประโยชน์อะไรเล่า?"],
14068=>["Value"=>14068,"TextKey"=>"剧情ID4050107","TextValue"=>"มาสร้างกองไฟไว้ทั้งสองฝั่งของบันไดกันเถอะ มันง่ายมาก!"],
14069=>["Value"=>14069,"TextKey"=>"剧情ID4060101","TextValue"=>"ฉันว่าแท่นบูชานี้... ยังขาดอะไรไปสักอย่าง เพราะว่าสัมผัสถึงเทพีไม่ได้เลย..."],
14070=>["Value"=>14070,"TextKey"=>"剧情ID4060102","TextValue"=>"แต่ว่ามันน่าจะเพียงพอในการสัมผัสถึงอะเมอร์กิ้น!"],
14071=>["Value"=>14071,"TextKey"=>"剧情ID4060103","TextValue"=>"หนาวจัง... ค... ใครอยู่ตรงนั้น?"],
14072=>["Value"=>14072,"TextKey"=>"剧情ID4060104","TextValue"=>"อะเมอร์กิ้น! อยู่ไหน?"],
14073=>["Value"=>14073,"TextKey"=>"剧情ID4060105","TextValue"=>"คุณ... คือเอ็นด้า? ฉันไม่รู้ว่าฉันอยู่ที่ไหน... แต่มันหนาวมากเลยที่นี่..."],
14074=>["Value"=>14074,"TextKey"=>"剧情ID4060106","TextValue"=>"หนาว?"],
14075=>["Value"=>14075,"TextKey"=>"剧情ID4060107","TextValue"=>"ดูเหมือนว่าจะไม่อยู่ที่นี่"],
