14078=>["Value"=>14078,"TextKey"=>"剧情ID4060110","TextValue"=>"เห้ เอ็นด้า ฉันว่า..."],
14079=>["Value"=>14079,"TextKey"=>"剧情ID4060111","TextValue"=>"L"&%*@#$"…"],
14080=>["Value"=>14080,"TextKey"=>"剧情ID4060112","TextValue"=>"อะเมอร์กิ้น! ทนไว้นะ! ฉันจะไปบอกคนอื่นเดี๋ยวนี้แหละ อาจจะช่วยคุณได้"],
14081=>["Value"=>14081,"TextKey"=>"剧情ID4060113","TextValue"=>"ทลาชท์ก้า เคยเจอเหตุการณ์แบบนี้ไหม?"],
14082=>["Value"=>14082,"TextKey"=>"剧情ID4060114","TextValue"=>"เฮ้..."],
14083=>["Value"=>14083,"TextKey"=>"剧情ID4060115","TextValue"=>"การสื่อสารกับวิญญาณไม่ใช่เรื่องที่ฉันถนัด แต่แม่ของฉันเคยเจอเหตุการณ์แบบนี้ ปัญหาน่าจะอยู่ที่แท่นบูชา"],
14084=>["Value"=>14084,"TextKey"=>"剧情ID4060116","TextValue"=>"แท่นบูชามีพลังอ่อนเกินไป มีบางอย่างสำคัญขาดหายไป"],
