14086=>["Value"=>14086,"TextKey"=>"剧情ID4060118","TextValue"=>"หัวหน้าเผ่า ฉันว่าฉันรู้แล้ว ดูข้างบนเสาของแท่นบูชาสิมันว่างเปล่า!"],
14087=>["Value"=>14087,"TextKey"=>"剧情ID4060119","TextValue"=>"พวกเราต้องเติมเต็มแก่นวิญญาณและเพิ่มพลังของแท่นบูชา พวกเรามีไหม?"],
14088=>["Value"=>14088,"TextKey"=>"剧情ID4060120","TextValue"=>"ว่าไงนะ? อาร์ลัน จะส่งให้เดี๋ยวนี้แหละ"],
14089=>["Value"=>14089,"TextKey"=>"剧情ID4060121","TextValue"=>"ไม่มีปัญหา!"],
